import React from 'react'
import './Header.css';

function Header() {
    return (
        <nav className="header">
            <img className="header__logo" src="http://pngimg.com/uploads/amazon/amazon_PNG2.png" alt="logo" ></img>
        </nav>
    )
}

export default Header
